import {
  FILE_UPLOAD_REQUEST,
  FILE_UPLOAD_SUCCESS,
  FILE_UPLOAD_FAIL,
  FILE_UPLOAD_RESET,
} from "../constants/fileConstant";
import axios from "axios";

const API = process.env.REACT_APP_API;

export const fileUpload = (formData) => async (dispatch) => {
  try {
    //console.log(formData);
    dispatch({ type: FILE_UPLOAD_REQUEST });
    const url = JSON.stringify(`${API}/file_upload`);
    console.log(2);
    const response = await axios
      .post(`http://localhost:5000/file_upload`, formData, {
        "Content-Type": "multipart/form-data",
        // "access-control-Allow-Origin": "http://localhost:3000",
      })
      .then((res) => {
        console.log(1);
      });
    dispatch({
      type: FILE_UPLOAD_SUCCESS,
      payload: response.json(),
    });
  } catch (error) {
    dispatch({
      type: FILE_UPLOAD_FAIL,
      payload:
        error.response && error.response.data.msg
          ? error.respone.data.msg
          : error,
    });
  }
};

export const sayHi = () => async (dispatch) => {
  try {
    console.log("calling data");

    // const { data } = axios
